(1501, 1481, '_themify_builder_settings', 'a:3:{i:0;a:2:{s:9:"row_order";s:1:"0";s:4:"cols";a:1:{i:0;a:2:{s:10:"grid_class";s:19:"col-full first last";s:7:"modules";a:1:{i:0;a:2:{s:8:"mod_name";s:4:"text";s:12:"mod_settings";a:1:{s:12:"content_text";s:178:"<h4>True drag & drop content builder that lets you build any page layouts with live frontend preview.<br />What you see is what you get. Works on desktop, tablet and mobile.</h4>";}}}}}}i:1;a:3:{s:9:"row_order";s:1:"1";s:4:"cols";a:1:{i:0;a:2:{s:10:"grid_class";s:19:"col-full first last";s:7:"modules";a:3:{i:0;a:2:{s:8:"mod_name";s:5:"image";s:12:"mod_settings";a:8:{s:11:"style_image";s:11:"image-right";s:9:"url_image";s:72:"http://themify.me/demo/themes/builder/files/2013/06/feature-settings.jpg";s:16:"appearance_image";s:7:"rounded";s:11:"width_image";s:3:"415";s:12:"height_image";s:3:"259";s:11:"title_image";s:13:"Themify Panel";s:13:"caption_image";s:391:"<h4>If we build a feature in the theme, we''ll build the options as well.</h4>\n<p>Along with the standard settings (favicon, logo image, header code, footer code, search & feed setting, etc.), each theme has its unique features which you can configure via the Settings tab. For example, if the theme has a feature box slideshow, you will have options to choose how the slideshow displays.</p>";s:9:"css_image";s:12:"feature-item";}}i:1;a:2:{s:8:"mod_name";s:5:"image";s:12:"mod_settings";a:7:{s:11:"style_image";s:10:"image-left";s:9:"url_image";s:69:"http://themify.me/demo/themes/builder/files/2013/06/feature-skins.jpg";s:11:"width_image";s:3:"415";s:12:"height_image";s:3:"263";s:11:"title_image";s:5:"Skins";s:13:"caption_image";s:384:"<h4>All themes come with at least one skin. Skins provide different looks for your theme without changing the core functionality.</h4>\n<p>Skins can be swapped in & out under the Skins tab. All skins come with a preview image similar to WordPress themes. You can also create custom skins: simply drop in a folder with the style.css and a screenshot and your skin will be available.</p>";s:9:"css_image";s:12:"feature-item";}}i:2;a:2:{s:8:"mod_name";s:5:"image";s:12:"mod_settings";a:8:{s:11:"style_image";s:11:"image-right";s:9:"url_image";s:77:"http://themify.me/demo/themes/builder/files/2013/06/feature-import-export.png";s:16:"appearance_image";s:7:"rounded";s:11:"width_image";s:3:"415";s:12:"height_image";s:3:"213";s:11:"title_image";s:15:"Import & Export";s:13:"caption_image";s:295:"<h4>Importing & Exporting has never been this easy, seriously.</h4>\n<p>Everything''s been taken care of. With our data structure in place you can make fast & clean backups of your settings easily. Export will generate a downloadable file of all your settings which you can import at any time.</p>";s:9:"css_image";s:12:"feature-item";}}}}}s:7:"styling";a:34:{s:9:"row_width";s:0:"";s:16:"animation_effect";s:8:"slide-up";s:16:"background_image";s:0:"";s:16:"background_color";s:0:"";s:17:"background_repeat";s:0:"";s:11:"font_family";s:7:"default";s:10:"font_color";s:0:"";s:9:"font_size";s:0:"";s:14:"font_size_unit";s:0:"";s:11:"line_height";s:0:"";s:16:"line_height_unit";s:0:"";s:10:"link_color";s:0:"";s:15:"text_decoration";s:0:"";s:11:"padding_top";s:0:"";s:13:"padding_right";s:0:"";s:14:"padding_bottom";s:0:"";s:12:"padding_left";s:0:"";s:10:"margin_top";s:0:"";s:12:"margin_right";s:0:"";s:13:"margin_bottom";s:0:"";s:11:"margin_left";s:0:"";s:16:"border_top_color";s:0:"";s:16:"border_top_width";s:0:"";s:16:"border_top_style";s:0:"";s:18:"border_right_color";s:0:"";s:18:"border_right_width";s:0:"";s:18:"border_right_style";s:0:"";s:19:"border_bottom_color";s:0:"";s:19:"border_bottom_width";s:0:"";s:19:"border_bottom_style";s:0:"";s:17:"border_left_color";s:0:"";s:17:"border_left_width";s:0:"";s:17:"border_left_style";s:0:"";s:14:"custom_css_row";s:0:"";}}i:2;a:3:{s:9:"row_order";s:1:"2";s:4:"cols";a:4:{i:0;a:2:{s:10:"grid_class";s:12:"col4-1 first";s:7:"modules";a:1:{i:0;a:2:{s:8:"mod_name";s:5:"image";s:12:"mod_setti