(1753, 1497, '_themify_builder_settings', 'a:1:{i:0;a:3:{s:9:"row_order";s:1:"0";s:4:"cols";a:2:{i:0;a:2:{s:10:"grid_class";s:12:"col4-2 first";s:7:"modules";a:1:{i:0;a:2:{s:8:"mod_name";s:9:"accordion";s:12:"mod_settings";a:5:{s:16:"layout_accordion";s:7:"default";s:25:"expand_collapse_accordion";s:6:"toggle";s:15:"color_accordion";s:10:"light-blue";s:30:"accordion_appearance_accordion";s:7:"rounded";s:17:"content_accordion";a:9:{i:0;a:3:{s:15:"title_accordion";s:47:"I get a blank screen after activating the theme";s:14:"text_accordion";s:174:"If you get a blank screen after activating the theme, it might be PHP errors or conflicts.\nTo fix it please see: <a href=''http://themify.me/faq#1''>http://themify.me/faq#1</a>";s:17:"default_accordion";s:4:"open";}i:1;a:2:{s:15:"title_accordion";s:31:"The images (img.php) are broken";s:14:"text_accordion";s:447:"We use a PHP script (img.php) called WordThumb (similar to TimThumb) to generate the image thumbnails. If the images appear broken, double check if the image file exists by viewing the image in a new window/tab (right-click on the image and select open image in a new tab). If the image file exists and error messages appears, most likely your server doesn''t support TimThumb. To enable it, send a request to your host provider to enable TimThumb.";}i:2;a:2:{s:15:"title_accordion";s:34:"What are the common img.php errors";s:14:"text_accordion";s:309:"<ul>\n<li>Cache Folder Permission</li>\n<li>img.php File permission</li>\n<li>Allowed memory size</li>\n<li>You may not fetch images from that site</li>\n<li>Large file size</li>\n<li>Image Library Module not enabled</li>\n</ul>\nFor more info please see: <a href=''http://themify.me/faq#2''>http://themify.me/faq#2</a>";}i:3;a:2:{s:15:"title_accordion";s:29:"How to disable img.php script";s:14:"text_accordion";s:522:"If you prefer not to use the img.php script, go to Themify > Settings > Image Script and check disable img.php script. Once the image script is disabled, a dropdown will be available for you to choose which image size to use. The image sizes (Thumbnail, Medium, Large) can be set at wp-admin > Settings > Media. In other words, you can specify 250 x 250px medium size to be used in the index pages and 560 x 300px large size for single post page. More on <a href=''http://themify.me/docs/featured-image''>Featured Image</a>.";}i:4;a:2:{s:15:"title_accordion";s:24:"The Themify doesn''t save";s:14:"text_accordion";s:211:"<ul>\n<li>Disable all plugins</li>\n<li>Reinstall the theme</li>\n<li>Password protection</li>\n<li>Update WordPress</li>\n</ul>\nFor more info please see: <a href=''http://themify.me/faq#3''>http://themify.me/faq#3</a>";}i:5;a:2:{s:15:"title_accordion";s:43:"I can''t upload images in the Themify panel!";s:14:"text_accordion";s:914:"If you can''t upload images in the Themify panel, double check the ''uploads'' folder in the theme. Make sure you have the write permission on that folder (755 or 777). To find out the folder permission: connect to your server with a <a href=''http://themify.me/docs/ftp''>FTP software</a>, go to the theme folder, right click on the ''uploads'' folder and view the folder info/property, make sure the permission is 755 or 777. Also, double check if your server allows HTTP upload. To check if your server allows HTTP upload, add a test post and upload a test image with the WordPress image uploader. If you get an error message when uploading images with the uploader, contact your host provider for assistance.\n\n<h4>Alternative Way:</h4>\nIf you can''t upload images via the option panel, upload the images using WordPress media uploader or FTP. Then copy and paste the image URL manually in the option panel input field.";}i:6;a:2:{s:15:"title_accordion";s:42:"I enabled the slider but it is not working";s:14:"text_accordion";s:104:"It might be Javascript conflicts cause by other plugins. Disable all plugins and check the slider again.";}i:7;a:2:{s:15:"title_accordion";s:59:"How do I upgrade the theme and find out the latest version?";s:14:"text_accordion";s:195:"Read this documentation on how to <a href=''http://themify.me/docs/upgrading-themes''>upgrade themes</a>. To find the latest theme version, view the <a href=''http://themify.me/logs''>changelogs</a>.";}i:8;a:2:{s:15:"title_accordion";s:42:"How do I trim the post with the more link?";s:14:"text_accordion";s:79:"Refer to <a href=''http://themify.me/docs/more-tag''>more link</a> documentation.";}}}}}}i:1;a:2:{s:10:"grid_class";s:11:"col4-2 last";s:7:"modules";a:1:{i:0;a:2:{s:8:"mod_name";s:9:"accordion";s:12:"mod_settings";a:5:{s:16:"layout_accordion";s:7:"default";s:25:"expand_collapse_accordion";s:6:"toggle";s:15:"color_accordion";s:10:"light-blue";s:30:"accordion_appearance_accordion";s:7:"rounded";s:17:"content_accordion";a:9:{i:0;a:3:{s:15:"title_accordion";s:55:"What is the difference between ''excerpt'' and ''content''?";s:14:"text_accordion";s:360:"<ul>\n<li><strong>Content:</strong> it will display the post''s content and trim at the <a href=''http://themify.me/docs/more-tag''>more link</a>.</li>\n<li><strong>Excerpt:</strong> it will display the post''s excerpt. If the post''s excerpt is empty, it will trim the content at the default length and strips out the HTML code such as img tag, link, etc.</li>\n</ul>";s:17:"default_accordion";s:4:"open";}i:1;a:2:{s:15:"title_accordion";s:29:"How do I upload a logo image?";s:14:"text_accordion";s:137:"Read this documentation on how to customize <a href=''http://themify.me/docs/customizing-site-logo-description''>site logo and tagline</a>.";}i:2;a:2:{s:15:"title_accordion";s:48:"How to disable comments on specific posts/pages?";s:14:"text_accordion";s:666:"<strong>To disable comments on all posts/page:</strong> go to Themify > Settings > Default Layouts, tick the ''Disable comments in all Posts'' and ''Disable comments in all Pages''.\n\n<strong>To disable comments on single post/page:</strong> when adding or editing a post/page, there should be a panel called ''Discussion''. If the Discussion panel is not visible, scroll to the top of the page and click ''Screen Options'', tick the ''Discussion'' checkbox, now the Discusion panel should be visible below the content box, uncheck ''Allow comments'' to disable comments on that post. Detail steps on how to <a href=''http://themify.me/docs/disable-comments''>disable comments</a>.";}i:3;a:2:{s:15:"title_accordion";s:53:"How do I translate the theme into different language?";s:14:"text_accordion";s:84:"Refer to <a href=''http://themify.me/docs/translating-themes''>Translating Themes</a>.";}i:4;a:2:{s:15:"title_accordion";s:57:"I get an error while trying to do the auto theme upgrade.";s:14:"text_accordion";s:168:"If the auto upgrade failed, please download the theme zip and upgrade manually with FTP (see tutorial: <a href=''http://themify.me/docs/upgrading-themes''>tutorial</a>) .";}i:5;a:2:{s:15:"title_accordion";s:55:"How do I change the text direction right to left (RTL)?";s:14:"text_accordion";s:154:"To change the text direction Right to Left (RTL) for Arabic language, go to Themify > Styling > Custom CSS and add the following:\n\nbody { direction:rtl; }";}i:6;a:2:{s:15:"title_accordion";s:44:"How to create custom Homepage and Blog page?";s:14:"text_accordion";s:399:"<ul>\n<li>First create a ''Blog'' page with the Blog category selected in <a href=''http://themify.me/docs/query-categories''>Query Categories</a>.</li>\n<li>Then create another page ''Homepage''.</li>\n<li>Now, go to WP Settings > Reading and set the ''Homepage'' as your static <a href=''http://themify.me/docs/front-page''>Front Page</a>. Do not set the ''Posts page'' option in the Reading settings.</li>\n</ul>";}i:7;a:2:{s:15:"title_accordion";s:33:"How to protect my WordPress site?";s:14:"text_accordion";s:589:"Check the following articles:\n<ul>\n<li><a href=''http://wp.smashingmagazine.com/2011/11/10/securing-your-wordpress-website/''>http://wp.smashingmagazine.com/2011/11/10/securing-your-wordpress-website/</a></li>\n<li><a href=''http://www.onextrapixel.com/2011/11/02/wordpress-security-how-to-secure-wordpress-thoroughly/''>http://www.onextrapixel.com/2011/11/02/wordpress-security-how-to-secure-wordpress-thoroughly/</a></li>\n<li><a href=''http://www.onextrapixel.com/2011/11/03/unleashing-htaccess-for-wordpress/''>http://www.onextrapixel.com/2011/11/03/unleashing-htaccess-for-wordpress/</a></li>";}i:8;a:2:{s:15:"title_accordion";s:32:"How to disable Themify upgrader?";s:14:"text_accordion";s:169:"To prevent checking for Themify theme upgrades so upgrade notices will no longer be displayed please see: <a href=''http://themify.me/faq#17''>http://themify.me/faq#17</a>";}}}}}}}s:7:"styling";a:34:{s:9:"row_width";s:0:"";s:16:"animation_effect";s:6:"fly-in";s:16:"background_image";s:0:"";s:16:"background_color";s:0:"";s:17:"background_repeat";s:0:"";s:11:"font_family";s:7:"default";s:10:"font_color";s:0:"";s:9:"font_size";s:0:"";s:14:"font_size_unit";s:0:"";s:11:"line_height";s:0:"";s:16:"line_height_unit";s:0:"";s:10:"link_color";s:0:"";s:15:"text_decoration";s:0:"";s:11:"padding_top";s:0:"";s:13:"padding_right";s:0:"";s:14:"padding_bottom";s:0:"";s:12:"padding_left";s:0:"";s:10:"margin_top";s:0:"";s:12:"margin_right";s:0:"";s:13:"margin_bottom";s:0:"";s:11:"margin_left";s:0:"";s:16:"border_top_color";s:0:"";s:16:"border_top_width";s:0:"";s:16:"border_top_style";s:0:"";s:18:"border_right_color";s:0:"";s:18:"border_right_width";s:0:"";s:18:"border_right_style";s:0:"";s:19:"border_bottom_color";s:0:"";s:19:"border_bottom_width";s:0:"";s:19:"border_bottom_style";s:0:"";s:17:"border_left_color";s:0:"";s:17:"border_left_width";s:0:"";s:17:"border_left_style";s:0:"";s:14:"custom_css_row";s:0:"";}}}'),
