(1, 1, '2015-07-31 02:49:41', '2015-07-31 02:49:41', 'Bienvenido a WordPress. Esta es tu primera entrada. Edítala o bórrala, ¡y comienza a publicar!.', '¡Hola mundo!', '', 'publish', 'open', 'open', '', 'hola-mundo', '', '', '2015-07-31 02:49:41', '2015-07-31 02:49:41', '', 0, 'http://localhost:8080/eventsc/?p=1', 0, 'post', '', 1),
(2, 1, '2015-07-31 02:49:41', '2015-07-31 02:49:41', 'Esto es una página de ejemplo. Es diferente a una entrada porque permanece fija en un lugar y se mostrará en la navegación de tu sitio (en la mayoría de los temas). La mayoría de la gente empieza con una página de Acerca de, que les presenta a los potenciales visitantes del sitio. Podría ser algo como esto:\n\n<blockquote>¡Hola! Soy mensajero por el día, aspirante a actor por la noche, y este es mi blog. Vivo en Madrid, tengo un perrazo llamado Duque y me gustan las piñas coladas (y que me pille un chaparrón)</blockquote>\n\n...o algo así:\n\n<blockquote>La empresa XYZ se fundó en 1971 y ha estado ofreciendo "cosas" de calidad al público desde entonces. Situada en Madrid, XYZ emplea a más de 2.000 personas y hace todo tipo de cosas sorprendentes para la comunidad de Madrid.</blockquote>\n\nSi eres nuevo en WordPress deberías ir a <a href="http://localhost:8080/eventsc/wp-admin/">tu escritorio</a> para borrar esta página y crear páginas nuevas con tu propio contenido. ¡Pásalo bien!', 'Página de ejemplo', '', 'trash', 'open', 'open', '', 'pagina-ejemplo', '', '', '2015-08-01 15:24:00', '2015-08-01 15:24:00', '', 0, 'http://localhost:8080/eventsc/?page_id=2', 0, 'page', '', 0),
