(2434, 1, '2015-08-01 15:09:29', '2015-08-01 15:09:29', 'Esperadísimo evento en ALIVE. Luego de mover acomodar y ordenar todo, al fin materializamos la fecha que reúne a dos grandes del rock Boliviano! ANIMAL DE CIUDAD presentando su nuevo disco y OIL continuando la promoción del CALAVERA!\r\n\r\n★OIL:\r\n\r\n◊ Chelo Navia / Vox - ElectroAcústica (12)\r\n◊ Pichón Aguilar / Electrica/ElectroAcústica (6)\r\n◊ Oli Devaux / Bajo\r\n◊ Pipo Lara / Bateria\r\n\r\n★ ANIMAL DE CIUDAD:\r\n\r\n◊ Ronaldo VPR (voz, guitarras &amp; producción ejecutiva)<span class="text_exposed_show">\r\n◊ Julio Rodríguez (bajo)\r\n◊ Jorge Ampuero (guitarras)\r\n◊ Johnny Molina (batería)</span>\r\n\r\nΩ COVER: 30 Bs.\r\n\r\n• Informes y Reservas : 2798297 - 79562582\r\n\r\n★.NUEVO MENÚ★\r\n\r\n◊ Tragos únicos de tus bandas rock fávoritas.\r\n◊ Un completo stock de bebidas clásicas.......\r\n\r\n♫ ALIVE MUSIC BAR: El Mejor Escenario Rock de La Paz ♪\r\n¡ Exclusivo para Rockers mayores de 18 años con C.I. !\r\n\r\nĦ ¡TE ESPERAMOS! Ħ!', '♫ALIVE♪ ►AL FIN! OIL y ANIMAL DE CIUDAD! ANIMOIL en LA PAZ ►SAB.08', '', 'publish', 'closed', 'closed', '', '%e2%99%abalive%e2%99%aa-%e2%96%baal-fin-oil-y-animal-de-ciudad-animoil-en-la-paz-%e2%96%basab-08', '', '', '2015-08-01 15:48:37', '2015-08-01 15:48:37', '', 0, 'http://localhost:8080/eventsc/?post_type=event&#038;p=2434', 0, 'event', '', 0),
